  "manifest_version": 3,
  "name": "Webpage Screenshot",
  "version": "1.0",
  "action": {
    "default_popup": "screenshot.html"
  },
  "permissions": [
    "activeTab",
    "storage",
    "downloads",
    "tabs",
    "http://*/*",
    "https://*/*"
  ],
  "background": {
    "service_worker": "background.js"
