`never` is a type in TypeScript that represents a value that will never be reached. It is used to indicate that a function or branch of code will never return a value, or that a variable will never be assigned a value. For example, a function that throws an error and never returns a value can be annotated with the `never` type. Using `never` can help catch errors and improve the type safety of your code.

